import { Link } from "react-router-dom";
import React from "react";
import MedianCol from "./images/MedianCol.png";


function Header() {
    const style = {

        global: {
             height: "100px",
            backgroundColor: "gray",
            display: "flex",
            justifyContent: 'center'
        },
        image:{
            height: '50%'
        }
    }
    return (
        <header style={style.global}>


            <nav>
                <div className="container">
                    <div>
                        <div></div>
                        <div className="container">

                            <div className="row">
                                <div className="col-sm-4">

                                    <img src={MedianCol} alt="app logo" style={style.image} />
                                </div>
                                <div className="col-sm-4"></div>
                                <div className="col-sm-1 mr-1">
                                    <Link to="/home">MedianCOL </Link>
                                </div>
                                <div className="col-sm-1 mr-1"><Link to="/projects"> About</Link></div>
                                <div className="col-sm-1"><Link to="/Contact"> LivingCost</Link></div>

                            </div>

                        </div>
                    </div>
                </div>

            </nav>
        </header>
    )
}

export default Header;
